    for i in range(len(str)):
        if str[i][0] == k:
            if len(words) > 0 and words[-1].word == str[i]:
                words[-1].cnt = words[-1].cnt + 1
            else:
                t = Word(str[i],1)
                words.append(t)

    if len(words) == 0:
